import React, { Component } from "react";
import ReactDOM from "react-dom";
import { BrowserRouter as Router, Route } from "react-router-dom";
import "./App.css";
import Home from "./pages/Home";
import Pay from "./pages/Pay";
import Bill from "./pages/Bill";
import Report from "./pages/Report";
import Bolt from "./pages/Bolt";
import Config from "./pages/Config";
import Logout from "./pages/Logout";
import Landing from "./pages/Landing";

class App extends Component {
  render() {
    return (
      <div>
        <Router>
          <switch>
            <Router exact path="/" component={Landing} />
            <Router path="/Home" component={Home} />
            <Router path="/Pay" component={Pay} />
            <Route path="/Bill" component={Bill} />
            <Router path="/Report" component={Report} />
            <Router path="/Bolt" component={Bolt} />
            <Router path="/Config" component={Config} />
            <Router path="/Logout" component={Logout} />
          </switch>
        </Router>
      </div>
    );
  }
}

export default App;
